  false,\n\t\"url\": null,\n\t\"notes\": \"Terrapoint collected Light Detection and
  Ranging (LiDAR) data contributing to the Puget Sound Lowlands project of 2005. Arlington,
  City of Snohomish, Snohomish Floodplains, Lummi-Nooksack, Nooksack North Fork, Marysville,
  Port Susan and Fisher Slough, Skagit Environmental Bank, Cavanaugh, Sauk South,
  Sauk South, Sauk-Suiattle, Skagit Bacon, Edmonds, Mt. Lake Terrace and Mukilteo
  of Central and North Central Washington. This data set covers approximately 5,285
  square miles. The Airborne LiDAR survey was conducted using Terrapoint?s 40 kHz
  ALTMS (Airborne Laser Terrain Mapping System), flying at an optimum height of 3500
  ft AGL at 140 knots. The system consists of a 36-degree full angle laser, a Trimble
  4700 GPS receiver and a Honeywell H764 IMU unit. This metadata is a collaboration
  of metadata reports from each of the individual 15 projects. The Puget Sound Lowlands
  project covers more areas over 2000-2004, these areas were excluded for this project.\",\n\t\"license_title\":
